import React from "react";
import "./styles.css";

import { toparrow, bottomarrow } from "../../assets/index.js";

import CustomLink from "../../components/ui/customLink/customLink.jsx";

const CardPage = () => {
  return (
    <div className="card-page">
      <div className="line-back">
        <CustomLink>
          <p>&larr;</p>
          <p>Back to catalog</p>
        </CustomLink>
      </div>
      <div className="sneaker-content">
        <div className="mat-images">
          <div className="swiper-container">
            <button>
              <img src={toparrow} />
            </button>
            <div className="swiper-wrapper"></div>
            <button>
              <img src={bottomarrow} />
            </button>
          </div>
          <div className="clone-image">
            <img src="" />
          </div>
        </div>
        <div className="right"></div>
      </div>
    </div>
  );
};

export default CardPage;
